const Header = () => {
  return (
    <div className='App-header'>
      <div className='App-logo'>
        <i class="fas fa-film"></i>
      </div>

      <div className='App-pages'>
        <p>Home</p>
        <p>Movies</p>
        <p>TV Series</p>
      </div>
    </div>
  )
}

export default Header;
